syntax = "proto3";

import "google/protobuf/timestamp.proto";
import "google/protobuf/duration.proto";

package io.moia.http2;

message TestMessage {
    google.protobuf.Timestamp timestamp = 1;
    google.protobuf.Duration duration = 2;
}

message PreviousTestMessage {
    google.protobuf.Timestamp timestamp = 1;
}
